SELECT lineitem.l_shipmode, lineitem.l_commitdate, MIN(lineitem.l_extendedprice) AS min_lineitem_l_extendedprice, VARIANCE(lineitem.l_linenumber) AS variance_lineitem_l_linenumber, VARIANCE(lineitem.l_extendedprice) AS variance_lineitem_l_extendedprice, MIN(lineitem.l_partkey) AS min_lineitem_l_partkey, COUNT(lineitem.l_quantity) AS count_lineitem_l_quantity FROM lineitem WHERE (lineitem.l_orderkey < 753) OR (lineitem.l_linestatus = 'XTDOE') AND lineitem.l_commitdate >= '2022-11-19' GROUP BY lineitem.l_shipmode, lineitem.l_commitdate HAVING COUNT(*) > 5652 AND COUNT(lineitem.l_quantity) > 59579 ORDER BY lineitem.l_shipmode, lineitem.l_commitdate